import React from "react";
import { quizData } from "./quizData";

const Quiz = () => {
  const renderGenres = (genres: string[]) => {
    return genres.map((genre: string, index: number) => <button />);
  };

  return <div>This is Quiz {this.renderGenres(quizData)}</div>;
};

export default Quiz;
